{"6": ["Единственное, что мне не понравилось-это глубина места для карточек,было бы чуть глубже,а так легко потерять. В остальном, пока всё нормально.", "2021-03-08T14:28:23Z", "рыжий", "0", 1, 0, 4, "Бумажник водителя с отделениями для купюр и карточек, кожаный", "Forte"], "8": ["Под СОР есть отделение. Под карточки есть отделения. А вот под ВУ нет отделения, если только воткнуть вместе с карточками. Ну у меня были прозрачные вкладыши, доработал бумажник. В принципе пойдёт, простой, тонкий (ничего лишнего) , на морозе при раскрытии ломаться не будет. ", "2021-02-28T22:36:16Z", "черный", "0", 1, 0, 5, "Бумажник водителя с отделениями для купюр и карточек, кожаный", "Forte"], "18": ["ТО ЧТО НАДО . КАК РАЗ ДЛЯ СОВРЕМЕННОСТИ . ВСЕГО-ТО ИЗ ДОКОВ ЭТО СТС И ВОДИТЕЛЬСКОЕ И ДЫРКА ДЛЯ ЗАНАЧКИ . СУПЕР .", "2021-01-31T18:45:03Z", "черный", "0", 1, 0, 5, "Бумажник водителя с отделениями для купюр и карточек, кожаный", "Forte"], "22": ["Отличная вещь. За полтора года практически нет заметного износа. Компактность и минимализм.", "2021-01-09T11:19:05Z", "черный", "0", 2, 0, 5, "Бумажник водителя с отделениями для купюр и карточек", "Forte"], "23": ["Искала именно такой - с минимальным набором вложений только для автодокументов! Понравился, нормальный размер и качество!", "2020-12-18T10:20:40Z", "красный", "0", 1, 0, 5, "Бумажник водителя с отделениями для купюр и карточек", "Forte"], "24": ["Хороший,маленький, компактный, то что искала.очень понравилась.", "2020-12-12T08:31:12Z", "красный", "0", 1, 0, 5, "Бумажник водителя с отделениями для купюр и карточек", "Forte"], "26": ["Очень неплохой бумажник, просто и бюджетно. Посмотрим как будет изнашиваться", "2020-12-07T07:54:40Z", "черный", "0", 1, 0, 5, "Бумажник водителя с отделениями для купюр и карточек", "Forte"], "27": ["Бумажник можно брать, удобно, всё в одном месте.", "2020-12-02T19:44:31Z", "черный", "0", 1, 0, 5, "Бумажник водителя с отделениями для купюр и карточек", "Forte"], "28": ["Самый оптимальный бумажник для водит